import React from 'react';
import styled from 'styled-components';
import Thumbnail from '../movie/Thumbnail'

const div = styled.div`
    height: auto;
    display: flex;
    flex-direction: row;
`

const Movies = () => {
    return (
        <Div>
            <Thumbnail />
        </Div>
    );
};

export default Movies;
